import React from 'react';
import './Ourstats.css';
import CountUp from 'react-countup';

function Ourstats() {
  return (
    <div className='stats-container'>
        <div className='left'> <CountUp end={80} duration={5} suffix={"+ members"} /> </div>
        <div className='mid'> <CountUp end={1000} duration={5} suffix={"+ memories created"} /> </div>
        <div className='right'> <CountUp end={1} duration={3} suffix={" commuinity made"}/> </div>
    </div>  
  )
}

export default Ourstats
